Z'YDRON is structured from the superposition of layers, mixing simple shapes and organic elements, a combo that is reminiscent of main characteristics often explored in my artworks, such as lights and shadows, full and empty, rhythm and frequency, in addition to flows and times. The resulting abstractions offer the observer different possibilities of reflection and connection with the work itself and invites to look beyond what is seen.

#Main Features
- 20 color schemes, including full black and white, grayscale and negative;
- 3 canvas formats;
- 3 hatch patterns;
- 3 forms of base painting;
- 3 degrees of granulometry;
In addition to the possibility of having or not having a border, a tag and being fully colored.

#Royalties split: 40% for minters.

Claimmable physical print: Minters of the three rarest pieces will receive an exclusive print, numbered and signed. In the size of 30x45 cm (11,8x17,7 inches) in high resolution.
The prints can be claimed by DM on Twitter @_morbeck_ or by email contato@mateusmorbeck.com

Other interested parties may purchase separately a printed and signed version of their edition.

